import MapView from 'react-native-maps';

const NewMap = () => {
  return (
    <>
    <MapView initialRegion={{
      latitude: 37.78825,
      longitude: -122.4324,
      latitudeDelta: 0.0922,
      longitudeDelta: 0.0421,
    }}></MapView>
    </>
  )
}
